import React from 'react';

const Task = ({ task, onDelete, onEdit }) => {
  const handleDelete = () => {
    onDelete(task.id);
  };

  const handleEdit = () => {
    onEdit(task.id);
  };

  return (
    <div>
      <span>{task.title}</span>
      <button onClick={handleEdit}>Edit</button>
      <button onClick={handleDelete}>Delete</button>
    </div>
  );
};

export default Task;
